			<key>shellPath</key>
			<string>/bin/sh</string>
			<key>shellScript</key>
			<string>exit 0
# This script will put a link to the plug-in in Aperture's plug-in's folder (~/library/app support/aperture/plug-ins/) if you're building in debug, but clears out the plug-in for release builds.

# Make sure the Aperture export plug-ins folder exists
if ! [ -d "${USER_LIBRARY_DIR}/Application Support/Aperture/Plug-Ins/Export" ]; then
mkdir -p "${USER_LIBRARY_DIR}/Application Support/Aperture/Plug-Ins/Export"
fi


# Clean up any previous products/symbolic links in the Aperture export plug-ins folder
if [ -a "${USER_LIBRARY_DIR}/Application Support/Aperture/Plug-Ins/Export/${FULL_PRODUCT_NAME}" ]; then
rm -Rf "${USER_LIBRARY_DIR}/Application Support/Aperture/Plug-Ins/Export/${FULL_PRODUCT_NAME}"
fi

# Depending on the build configuration, link to the most recent product
if [ "${CONFIGURATION}" == "Debug" ]; then
# if we're debugging, add a symbolic link to the plug-in
ln -sf "${TARGET_BUILD_DIR}/${FULL_PRODUCT_NAME}" \
"${USER_LIBRARY_DIR}/Application Support/Aperture/Plug-Ins/Export/${FULL_PRODUCT_NAME}"
fi</string>
